    List<LoginRequest> listUser = new List<LoginRequest>();
    List<Roles> roles = new List<Roles>();
    Users model = new Users();
    //GetSessionInfo
    long CompanyId;
    long RoleId;
    public byte[] ImageUploaded { get; set; }
    Privilege privi = new Privilege();
    string strMenu = "User";
    bool strAdd = true;
    bool strEdit = true;
    bool strDelete = true;
    bool strShow = true;
    protected async override void OnInitialized()
    {
        CompanyId = await sessionStorage.GetItemAsync<long>("CompanyId");
        RoleId = await sessionStorage.GetItemAsync<long>("RoleId");
        //CheckPriviliage
        privi = priviliageRepository.PriviliageCheck(strMenu, RoleId, CompanyId);
        if (privi != null)
        {
            strAdd = privi.AddAction;
            strEdit = privi.EditAction;
            strDelete = privi.DeleteAction;
            strShow = privi.ShowAction;
            if (strShow == false)
            {
                Snackbar.Add("You dont have to privilege.", Severity.Success);
                navManager.NavigateTo("dashboard");
            }
        }
        else
        {
            strAdd = true;
            strEdit = true;
            strDelete = true;
            strShow = true;
        }
        Load();
        StateHasChanged();
    }
    protected void Load()
    {
        model.UserId = 0;
        model.EmailAddress = string.Empty;
        model.FirstName = string.Empty;
        model.LastName = string.Empty;
        model.Password = "0000000";
        listUser = authService.ViewUser(CompanyId);
        roles = authService.ViewRole();
    }
    public void SaveUser()
    {
        if (model.RoleId == 0)
        {
            Snackbar.Add("Choose Role.", Severity.Info);
            return;
        }
        else if (model.EmailAddress == string.Empty)
        {
            Snackbar.Add("Type Email.", Severity.Info);
            return;
        }
        else if (model.FirstName == string.Empty)
        {
            Snackbar.Add("Type FirstName.", Severity.Info);
            return;
        }
        else if (model.Password == string.Empty)
        {
            Snackbar.Add("Type Password.", Severity.Info);
            return;
        }
        else if (model.ConfirmPassword == string.Empty)
        {
            Snackbar.Add("Type ConfirmPassword.", Severity.Info);
            return;
        }
        else
        {
            if (model.UserId == 0)
            {
                if (strAdd == true)
                {
                    model.Password = Utility.Encrypt(model.Password);
                    model.CompanyId = CompanyId;
                    model.Source = "Dreamer";
                    model.HireDate = DateTime.Now;
                    bool isSave = false;
                    isSave = authService.Save(model);
                    if (isSave == true)
                    {
                        Snackbar.Add("Saved Successfully.", Severity.Success);
                        Load();
                        navManager.NavigateTo("auth/register");
                    }
                    else
                    {
                        Snackbar.Add("Already exists.", Severity.Success);
                        navManager.NavigateTo("auth/register");
                    }
                }
                else
                {
                    Snackbar.Add("You dont have to priviliage.", Severity.Success);
                    navManager.NavigateTo("dashboard");
                }
            }
            else
            {
                if (strEdit == true)
                {
                    model.Password = Utility.Encrypt(model.Password);
                    model.CompanyId = CompanyId;
                    model.Source = "Dreamer";
                    if (authService.Update(model))
                    {
                        Snackbar.Add("Updated Successfully.", Severity.Success);
                        Load();
                        navManager.NavigateTo("auth/register");
                    }
                    else
                    {
                        Snackbar.Add("Already Exists.", Severity.Success);
                        navManager.NavigateTo("auth/register");
                    }
                }
                else
                {
                    Snackbar.Add("You dont have to privilege.", Severity.Success);
                    navManager.NavigateTo("dashboard");
                }
            }
        }
    }
    async Task Delete(long id)
    {
        if (strDelete == true)
        {
            bool confirmed = await JsRuntime.InvokeAsync<bool>("confirm", "Are you sure?");
            if (confirmed)
            {
                if (model.UserId == 1)
                {

                    bool isSave = false;
                    isSave = authService.Delete(id);
                    if (isSave == true)
                    {
                        Snackbar.Add("Deleted Successfully.", Severity.Success);
                        Load();
                        navManager.NavigateTo("auth/register");
                    }
                    else
                    {
                        Snackbar.Add("Cannot be delete. already in used.", Severity.Info);
                        navManager.NavigateTo("auth/register");
                    }
                }
                else
                {
                    Snackbar.Add("Default admin cannot be delete.", Severity.Info);
                    navManager.NavigateTo("auth/register");
                }
            }
        }
        else
        {
            Snackbar.Add("You dont have to privilege.", Severity.Info);
            navManager.NavigateTo("dashboard");
        }
    }
    void Edit(long id)
    {
        model = authService.Edit(Convert.ToInt64(id));
    }
    void Cancel()
    {
        Load();
    }

